import CreateTable from '../Partials/CreateTable';
import DetailVehiculo from './DetailVehiculo';
import { getVehiculos, postDeleteVehiculo } from '../../Utils/Vehiculo';

export default function VehiculoTablActivos(props) {
    const { changeFrame } = props;
    return (
        <CreateTable
            fetchGet={getVehiculos}
            fetchDelete={postDeleteVehiculo}
            title="Vehiculos"
            DetailComponent={DetailVehiculo}
            changeFrame={changeFrame}
            id="patente"
            table={[
                { column: "Patente", filter: ["patente"], row: ["patente"] },
                { column: "Año", filter: ["año"], row: ["año"] },
                { column: "Modelo", filter: ["modelo", "nombre"], row: ["modelo", "nombre"] },
                { column: "Marca", filter: ["modelo", "marca", "nombre"], row: ["modelo", "marca", "nombre"] },
                { column: "Cliente nombre", filter: ["cliente", "nombre"], row: ["cliente", "nombre"] },
                { column: "Cliente apellido", filter: ["cliente", "apellido"], row: ["cliente", "apellido"] }]}
            vocabulary={{
                singular: "vehiculo",
                id: ["patente"],
                pronombre: "el"
            }} />
    );
};
